import React from 'react';

function ProjectCard({ title, date, description, tags }) {
  return (
    <div className="bg-white shadow-md rounded-lg p-4 mb-6">
      <div className="text-blue-700 font-bold text-lg mb-2">{title}</div>
      <div className="text-gray-500 text-sm mb-4">{date}</div>
      <p className="text-gray-800 mb-4">{description}</p>
      <div className="flex flex-wrap gap-2">
        {tags.map(tag => (
          <span key={tag} className="bg-blue-100 text-blue-700 text-xs font-semibold px-3 py-1 rounded-full">
            {tag}
          </span>
        ))}
      </div>
    </div>
  );
}

function HomePage() {
  const projects = [
    {
      title: "Project Name 1",
      date: "Fall 2024 / author",
      description: "description",
      tags: ["JavaScript", "HTML", "CSS"]
    },
    {
      title: "Project Name 2",
      date: "Fall 2024 / author",
      description: "description",
      tags: ["Java", "React"]
    },
    {
      title: "Project Name 3",
      date: "Fall 2024 / author",
      description: "description",
      tags: ["JavaScript", "HTML", "Spring Boot"]
    },
    {
      title: "Project Name 4",
      date: "Fall 2024 / author",
      description: "description",
      tags: ["JavaScript", "HTML", "Spring Boot"]
    },
    {
      title: "Project Name 5",
      date: "Fall 2024 / author",
      description: "description",
      tags: ["JavaScript", "HTML", "Spring Boot"]
    }
  ];

  return (
    <div className="bg-gray-100 min-h-screen p-6">
      <div className="max-w-2xl mx-auto">
        {projects.map((project, index) => (
          <ProjectCard
            key={index}
            title={project.title}
            date={project.date}
            description={project.description}
            tags={project.tags}
          />
        ))}
      </div>
      <div className="flex justify-between mt-4">
        <button className="text-blue-700">Previous</button>
        <button className="text-blue-700">Next</button>
      </div>
    </div>
  );
}

export default HomePage;
